import * as serviceWorker from './serviceWorker';
import store from './redux/state.js'
import React from 'react';
import ReactDOM from 'react-dom';
import s from './App.module.css';
import App from './App';
// import {addData_bag, ubdateTodayTextarea} from './redux/state'

let render_Tree = (state) => {
    ReactDOM.render(<App
        data={store.getState}
        addData_bag={store.documentaddData_bag}
        ubdateTodayTextarea={store.documentubdateTodayTextarea}
    />, document.getElementById('root'));
}

render_Tree(store.getState);
store.subscribe(render_Tree);

serviceWorker.unregister();
